
$(document).ready(function(){var calendarNavSlider=$('.calendar-nav__list').owlCarousel({loop:false,nav:false,mouseDrag:false,touchDrag:false,responsive:{0:{items:3,margin:12},750:{items:5,margin:12},980:{items:7,margin:19,}}});$('.calendar-nav__btn--prev').click(function(){calendarNavSlider.trigger('prev.owl.carousel',[300]);});$('.calendar-nav__btn--next').click(function(){calendarNavSlider.trigger('next.owl.carousel',[300]);});$('a[data-toggle="tab"]').on('shown.bs.tab',function(e){$(e.target).parents('.owl-item').siblings().find('.calendar-nav__item').removeClass('active');});$('.selected-filters-bar--big .selected-filters-bar__list').droptabs({development:false,pullDropdownRight:false});$('.dropdown-toggle').click(function(e){e.preventDefault();if($(this).parent('.dropdown').hasClass('open')){$(this).parent('.dropdown').removeClass('open');}else{$(this).parent('.dropdown').addClass('open');}});$(document).on('click',function(e){if($(e.target).closest(".dropdown").length)return;$('.dropdown').removeClass('open');e.stopPropagation();});});